import React from 'react';
import Card from './card';
const App = () => {
  return (
    <div>
      <Card
        title="Sample Card 1"
        description="This is a sample card with a description."
      />
      <Card
        title="Sample Card 2"
        description="Another card with a different description."
        image="https://example.com/sample-image.jpg"
      />
    </div>
  );
};

export default App;
